
-- POSTGRESQL FULL BUILD FILE

DROP TABLE IF EXISTS participant_events CASCADE;
DROP TABLE IF EXISTS donations CASCADE;
DROP TABLE IF EXISTS milestones CASCADE;
DROP TABLE IF EXISTS events CASCADE;
DROP TABLE IF EXISTS eventtype CASCADE;
DROP TABLE IF EXISTS participants CASCADE;

CREATE TABLE participants (
    participantemail VARCHAR(255) PRIMARY KEY,
    participantfirstname VARCHAR(100),
    participantlastname VARCHAR(100),
    participantdob DATE,
    participantrole VARCHAR(100),
    participantphone VARCHAR(50),
    participantcity VARCHAR(100),
    participantstate VARCHAR(50),
    participantzip VARCHAR(20),
    participantschooloremployer VARCHAR(255),
    participantfieldofinterest VARCHAR(255)
);

CREATE TABLE eventtype (
    eventtypeid INTEGER GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    eventname VARCHAR(255),
    eventtype VARCHAR(255),
    eventdescription TEXT,
    eventrecurrencepattern VARCHAR(100),
    eventdefaultcapacity INTEGER
);

CREATE TABLE events (
    eventid INTEGER PRIMARY KEY,
    eventname VARCHAR(255),
    eventtypeid INTEGER,
    eventdate DATE,
    eventstarttime TIME,
    eventendtime TIME,
    eventlocation VARCHAR(255),
    eventcapacity INTEGER,
    eventregistrationdeadlinedate DATE,
    eventregistrationdeadlinetime TIME,
    FOREIGN KEY (eventtypeid) REFERENCES eventtype(eventtypeid)
);

CREATE TABLE participant_events (
    participanteventid INTEGER GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    participantemail VARCHAR(255),
    eventname VARCHAR(255),
    eventid INTEGER,
    registrationstatus VARCHAR(100),
    registrationattendedflag VARCHAR(10),
    registrationcreatedat_date DATE,
    registrationcreatedat_time TIME,
    registrationcheckintime_date DATE,
    registrationcheckintime_time TIME,
    surveysatisfactionscore INTEGER,
    surveyusefulnessscore INTEGER,
    surveyinstructorscore INTEGER,
    surveyrecommendationscore INTEGER,
    surveyoverallscore INTEGER,
    surveynpsbucket VARCHAR(50),
    surveycomments TEXT,
    surveysubmissiondate DATE,
    FOREIGN KEY (participantemail) REFERENCES participants(participantemail),
    FOREIGN KEY (eventid) REFERENCES events(eventid)
);

CREATE TABLE donations (
    donationid INTEGER GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    participantemail VARCHAR(255),
    donationdate DATE,
    donationamount NUMERIC(10,2),
    FOREIGN KEY (participantemail) REFERENCES participants(participantemail)
);

CREATE TABLE milestones (
    milestoneid INTEGER GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    participantemail VARCHAR(255),
    milestonetitle VARCHAR(255),
    milestonedate DATE,
    FOREIGN KEY (participantemail) REFERENCES participants(participantemail)
);




























































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































